import './aboutMe_body.css';

import React, { useEffect } from 'react';
import Particles from 'react-particles-js';

const AboutMe_body = () =>{
	return(
		<React.Fragment>
			<div class="aboutMe_body">
				<Particles
    				params={{
					    "fps_limit": 28,
					    "particles": {
					        "collisions": {
					            "enable": false
					        },
					        "number": {
					            "value": 200,
					            "density": {
					                "enable": false
					            }
					        },
					        "line_linked": {
					            "enable": true,
					            "distance": 30,
					            "opacity": 0.4
					        },
					        "move": {
					            "speed": 1
					        },
					        "opacity": {
					            "anim": {
					                "enable": true,
					                "opacity_min": 0.05,
					                "speed": 1,
					                "sync": false
					            },
					            "value": 0.4
					        }
					    },
					    "polygon": {
					        "enable": true,
					        "scale": 0.5,
					        "type": "inline",
					        "move": {
					            "radius": 10
					        },
					        "url": "/small-deer.2a0425af.svg",
					        "inline": {
					            "arrangement": "equidistant"
					        },
					        "draw": {
					            "enable": true,
					            "stroke": {
					                "color": "rgba(255, 255, 255, .2)"
					            }
					        }
					    },
					    "retina_detect": false,
					    "interactivity": {
					        "events": {
					            "onhover": {
					                "enable": true,
					                "mode": "bubble"
					            }
					        },
					        "modes": {
					            "bubble": {
					                "size": 6,
					                "distance": 40
					            }
					        }
					    }
					}} />

			</div>
		</React.Fragment>
	);
}

export default AboutMe_body;
